macro gen_dummy_cmps [cmd] {
forward
  cmp rax, Cmd#cmd#CsReq
  je .#cmd#_dummy_branch
}

macro gen_dummy_branches [cmd] {
forward
.#cmd#_dummy_branch:
  mov r8, 0 ; r8 = body_len
  mov r9, Cmd#cmd#ScRsp
  jmp .send_rsp
}

